import React, {Component, Fragment} from 'react';

class Header extends Component {
  shouldComponentUpdate(){
    return false;
  }
  render(){
    console.log("Header");
    return(
      <Header>
        <h1>{this.props.title}</h1>
        {this.props.body}
      </Header>
    )
  }
}

const HeaderSass = styled.div`
  max-width: 100%;
  border: 1px solid #000;
  font-size: 100px;
  text-align: center;
`;

export default Header;
